import React from 'react';
import Button from '@mui/material/Button';
import Avatar from '@mui/material/Avatar'; // Importa el componente Avatar
import DeleteIcon from '@mui/icons-material/Delete';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import { Container, Grid, TextField } from '@mui/material';
import Paper from '@mui/material/Paper';
import { useNavigate } from 'react-router-dom';
// Importa el useDispatch del react-redux
import { useDispatch } from 'react-redux';
// Importa el componente loginActions que está en el fichero storelogin.js
import { loginActions } from '../store/storelogin';

function Login() {
  const navigate = useNavigate();
  const dispatch = useDispatch();

  return (
    <Container>
      <Grid container justifyContent="center" alignItems="center">
        <Grid item xs={12} sm={6} md={4} lg={3} xl={2}>
          <Box
            sx={{
              display: 'flex',
              flexDirection: 'column',
              alignItems: 'center',
              justifyContent: 'center',
              minHeight: '500px',
              minWidth: '400px'
            }}
          >
            <Paper elevation={5}>
              {/* Agregar el Avatar con una imagen */}
              <Avatar
                sx={{
                  width: 80,
                  height: 80,
                  backgroundColor: 'primary.main',
                }}
              >
                <img
                  src="ruta_de_la_imagen.jpg" // Reemplaza con la ruta de tu imagen de avatar
                  alt="Avatar"
                  style={{
                    width: '100%',
                    height: '100%',
                    objectFit: 'cover',
                  }}
                />
              </Avatar>
              <Typography variant="h6" component="h1" sx={{ textAlign: 'center' }}>
                Acceder
              </Typography>
              <TextField required fullWidth id="usuario" variant="outlined" label="Usuario" />
              <TextField required fullWidth id="contraseña" variant="outlined" label="Contraseña" type="password" />
              <Button variant="contained" color="primary" fullWidth>
                Iniciar Sesión
              </Button>
            </Paper>
          </Box>
        </Grid>
      </Grid>
    </Container>
  );
}

export default Login;
